import "./styles.css";
import Plx from 'react-plx';

export default function App() {
  return (
    <div>
      {/* Foreground image with parallax effect */}
      <Plx
        parallaxData={[
          {
            start: 0,
            end: 700,
            easing: "ease-in",
            properties: [
              {
                startValue: 1,
                endValue: 1.6,
                property: "scale"
              }
            ]
          }
        ]}
        className="foreground-image parallax-element"
      >
        <img className="foreground-image" src="bg.png" alt="foreground" />
      </Plx>

      {/* Background image with parallax effect */}
      <Plx
        parallaxData={[
          {
            start: 0,
            end: 800,
            properties: [
              {
                startValue: 1,
                endValue: 1.18,
                property: "scale"
              }
            ]
          }
        ]}
        className="background-image parallax-element"
      >
        <img className="background-image" src="background.jpg" alt="background" />
      </Plx>

      {/* Text image with opacity change */}
      <Plx
        parallaxData={[
          {
            start: 0,
            end: 400,
            properties: [
              {
                startValue: 1,
                endValue: 0,
                property: "opacity"
              }
            ]
          }
        ]}
        className="text-image parallax-element"
      >
        <img className="text-image" src="/text-img.webp" alt="Goonies" />
      </Plx>

      {/* Main container with background filler */}
      <div className="main-container">
        <div className="background-filler"></div>
      </div>

      {/* New parallax section */}
      <div className="new-parallax-section">
        <Plx
          parallaxData={[
            {
              start: 'self',
              startOffset: '80vh',
              duration: '200vh',
              properties: [
                {
                  startValue: 0,
                  endValue: 1,
                  property: "opacity"
                },
                {
                  startValue: 1,
                  endValue: 1.5,
                  property: "scale"
                }
              ]
            }
          ]}
          className="new-parallax-content"
        >
          <h1>Next Page Content</h1>
        </Plx>
      </div>
    </div>
  );
}
